export const UPDATE_COUNT = "UPDATE_COUNT";
export const UPDATE_IDS = "UPDATE_IDS";

const getInitialQuery = (results : any) => ({
    type: UPDATE_COUNT,
    results
});

const updateData = (results: any) => ({
    type: UPDATE_IDS,
    results
});

export { getInitialQuery, updateData };
